import React, { Component } from 'react';
import insync from './images/mockup-insync.png';
import './Developer.css';

class Developer extends Component {
  render() {
    return (
      <div id={this.props.id} className="Developer main-section">
        <header className="section-header">
          <p>i'm a developer...</p>
        </header>
        <div className="Dev-body">
          <a><img src={insync} className="Dev-mockup" alt="insync" /></a>
          <a><img src={insync} className="Dev-mockup" alt="project2" /></a>
          <a><img src={insync} className="Dev-mockup" alt="project3" /></a>
          <a><img src={insync} className="Dev-mockup" alt="project3" /></a>
        </div>
      </div>
    );
  }
}

export default Developer;
